DROP TABLE IF EXISTS `ocorrencia`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `ocorrencia` (
  `id` int NOT NULL AUTO_INCREMENT,
  `aluno` int DEFAULT NULL,
  `tipo_ocorrencia` int DEFAULT NULL,
  `descricao` text,
  `servidor` varchar(255) DEFAULT NULL,
  `setor_registro` int DEFAULT NULL,
  `setor_destino` int DEFAULT NULL,
  `data_ocorrencia` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `nome_aluno` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `aluno` (`aluno`),
  KEY `tipo_ocorrencia` (`tipo_ocorrencia`),
  KEY `setor_registro` (`setor_registro`),
  KEY `setor_destino` (`setor_destino`),
  CONSTRAINT `ocorrencia_ibfk_1` FOREIGN KEY (`aluno`) REFERENCES `aluno` (`id`),
  CONSTRAINT `ocorrencia_ibfk_2` FOREIGN KEY (`tipo_ocorrencia`) REFERENCES `tipo_ocorrencia` (`id`),
  CONSTRAINT `ocorrencia_ibfk_3` FOREIGN KEY (`setor_registro`) REFERENCES `setor` (`id`),
  CONSTRAINT `ocorrencia_ibfk_4` FOREIGN KEY (`setor_destino`) REFERENCES `setor` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4826 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
