INSERT INTO `ocorrencia` VALUES (2,729,9,'Matrícula trancada no curso subsequente técnico em informática','Adriana Coimbra Rodrigues',17,2,'2020-10-13 03:00:00','ISABELA BRINGEL DE DEUS'),(4,1074,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-13 03:00:00','NÚBIA FERNANDES CERQUEIRA'),(5,292,6,'Entrega de atividades no google sala de aula com atraso. Conversei com a mãe, a mesma afirmou que por conta do trabalho não está tendo tempo de acompanhar a filha mais de perto, mas que vai cobrá-la para que se dedique nos estudos.','Haroldo Pereira Costa',18,14,'2020-10-13 03:00:00','SABRINA ALVES DOS SANTOS DE ARAÚJO'),(6,533,6,'Entrega de atividades no google sala de aula com atrasos. Telefones indicados na ficha do estudante fora de área  ','Haroldo Pereira Costa',18,14,'2020-10-13 03:00:00','DAVID ARAÚJO RODRIGUES'),(7,350,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-13 03:00:00','ADINALVA MOREIRA DOS SANTOS'),(8,351,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-13 03:00:00','ADNA MOREIRA DOS SANTOS'),(9,178,6,'Entrega de atividades no google sala de aula com atrasos. Segundo a mãe não há motivos para ela atrasar atividades, tem internet, sempre lhe fala que está estudando. Vai cobrar e acompanhá-la mais de perto. ','Haroldo Pereira Costa',18,14,'2020-10-13 03:00:00','KAUANNY CIBELLY BORGES CARDOSO'),(10,929,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-13 03:00:00','LÚCIA GONÇALVES DE MELO'),(11,403,6,'Entrega de atividades no google sala de aula com atrasos. Disse que às vezes fica sem internet e que por isso não entrega no prazo ou não faz. Reforcei da necessidade de dedicação ao estudos.','Haroldo Pereira Costa',18,14,'2020-10-13 03:00:00','ANA CRISTINA LOURENÇO SENA'),(12,996,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-13 03:00:00','MARIA NETA MAGALHÃES MACEDO'),(13,6,6,'Deixando de fazer as atividades no google sala de aula. Por telefone falou que devido não ter feito in