das as atividades propostas pelos professores. ','Lucivan Augusto da Silva',18,11,'2020-10-20 03:00:00','ARISTEU MIGUEL DA SILVA'),(83,640,6,'Falei com a aluna. Disse que mãe e avó estavam doentes com covid19. Está em atraso com algumas disciplinas, porém vai colocar tudo em dias. Orientei quanto a necessidade de realizar todas as atividades.  ','Lucivan Augusto da Silva',18,11,'2020-10-20 03:00:00','GABRIELA SOUZA SILVA'),(84,713,6,'Não consegui contato com o telefone cadastrado no siga. ','Lucivan Augusto da Silva',18,11,'2020-10-20 03:00:00','HENRIQUE MOREIRA DOS SANTOS'),(85,208,6,'Aluno não está fazendo algumas atividades. Falei com a mãe do aluno sobre a situação. A mãe disse que não concorda com essas aulas remota, porém é uma situação atípica. Falei sobre a necessidade de realizar as atividades propostas pelos professores.','Lucivan Augusto da Silva',18,11,'2020-10-20 03:00:00','LUCIANO MIRANDA DOS SANTOS'),(86,207,6,'Aluno não está fazendo algumas atividades. Falei com a mãe do aluno sobre a situação. A mãe disse que não concorda com essas aulas remota, porém é uma situação atípica. Falei sobre a necessidade de realizar as atividades propostas pelos professores.','Lucivan Augusto da Silva',18,11,'2020-10-20 03:00:00','LUCAS MIRANDA DOS SANTOS'),(87,534,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-21 03:00:00','DAVID RODRIGUES DE SOUSA'),(88,554,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-21 03:00:00','DIEGO PEREIRA DE OLIVEIRA'),(89,750,9,'Desligada do curso de Licenciatura em Computação\n','Adriana Coimbra Rodrigues',17,2,'2020-10-21 03:00:00','JANAINE MOREIRA DE ARAUJO'),(90,619,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-21 03:00:00','FELIPE MOURA FERNANDES'),(91,563,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-21 03:00:00','DOUGLAS OLIVEIRA LIMA'),(92,557,9,'Matrícula trancada','Adriana Coimbra Rodrigues',17,2,'2020-10-21 03:00:00','DIOGO LIMA DURANTE'),(94,1131,6,'Falei c